"use client"
import Image from "next/image";
import styles from "./page.module.scss";
import '../scss/index.scss'
import Header from '@components/header'
import { useState, useEffect } from 'react'


export default function Home() {

  const [placeholder, setPlaceholder] = useState('');

  // Convertir la imagen a base64 para usarla como blurDataURL
  useEffect(() => {
    //debugger
    const convertToBase64 = async () => {

      const response = await fetch('/images/banner.png'); // Ruta de tu imagen de marcador de posiciÃ³n
      const blob = await response.blob();

      const reader = new FileReader();
      reader.onloadend = () => {
        setPlaceholder(reader.result);
      };
      reader.readAsDataURL(blob);
    };

    convertToBase64();
  }, []);


  return (
    <main className="o-container">
      <Header />
      {/* <div className="blur blur--left"></div> */}
      <Image src='/images/banner.png' width={480} height={560} placeholder="blur" blurDataURL="data:image/png;base64," />
    </main>
  );
}
